uil-rotate-slider (slider : class uil-slider)
pointer : class uil-slider-pointer;
begin
pointer = the uil-slider-pointer that is the-pointer-in slider;
conclude that the orientation of slider = the orientation of slider + 90;
if the orientation of slider > 270 then
  conclude that the orientation of slider = 0;
rotate slider by 90 degrees;
rotate pointer by 90 degrees;
call upp-rebind-pointer-boundaries (pointer);
call upp-move-slider (slider);

end

uil-set-slider-value(DlgOrWksp : class item, Id : text, Val : quantity, Win : class ui-client-item) 
Slider : item-or-value;
begin
    Slider = call uil-get-grobj-from-id-on-dlg-or-wksp (Id, DlgOrWksp);
    if Slider is an item then begin
        if (Val >= the lo-value of Slider) and (Val <= the hi-value of Slider) then begin
            call upp-set-slider-value(Slider, Val);
            call upp-execute-value-changed-callback (Slider, Win, DlgOrWksp);
        end
        else signal the symbol uil-error, uil-error-slider-invalid-value(Val, the lo-value of Slider, the hi-value of Slider);
    end
    else signal the symbol uil-error, uil-error-slider-invalid-id(id); 
end

uil-create-slider (class-to-create : symbol, low: quantity, high: quantity) = (item-or-value)
slider : class uil-slider;
pointer : class uil-slider-pointer;
en : symbol; et : text;
begin
    if (class-to-create = the symbol uil-slider) then
        class-to-create = the symbol uil-slider-regular;
    create an instance slider of the class named by class-to-create;
    conclude that the hi-value of slider = high;
    conclude that the lo-value of slider = low;
    create an instance pointer of the class named by the uil-slider-pointer-class-to-create of slider;
    conclude that slider is the-container-for pointer;
    return slider;
end 
on error (en, et)
return the symbol slider-not-created;
end

uil-get-slider-value(DlgOrWksp : class item, Id : text, Win : class ui-client-item) = (quantity)
Slider : item-or-value;
Val : quantity;
begin
    Slider = call uil-get-grobj-from-id-on-dlg-or-wksp (Id, DlgOrWksp);
    if Slider is an item then begin
        Val = call upp-get-slider-value(Slider);
        return Val;
    end
    else signal the symbol uil-error, uil-error-slider-invalid-id(id);
end

upp-conclude-slider-method (G: item-or-value, W: class ui-client-item, D: item-or-value, B:item-or-value, action-queue: item-or-value)
OBJ: item-or-value;
ATT : symbol;
DEBUG: truth-value = false;
begin 
if (DEBUG) then
    inform the operator that "running upp-conclude-slider-method";

    OBJ  = call uil-find-target-object (G, D);
    if OBJ is not an item then
        return;

    ATT = the uil-event-target-attribute of G;

    if (the current-value of G does not exist or the current-value of G = the symbol none) then
        begin
        if DEBUG then
            inform the operator that "No value for uil-slider";
       call upp-conclude-none-to-target (OBJ, ATT);
       end
    else
        begin
        if DEBUG then
            inform the operator that "Slider value: [the current-value of G]";
        call upp-conclude-value-to-target (OBJ, ATT, the current-value of G);
        end;

    if (OBJ is a uil-grobj or OBJ is a uil-grmes) and the uil-is-permanent of G is true then
        call uil-make-grobj-permanent (OBJ);

    call upp-refresh-grobj (OBJ);
end

upp-manage-slider-method (slider : class uil-slider, WS : class kb-workspace, config: item-or-value, x : integer, y : integer) = (class uil-slider)
pointer: class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
mode : symbol ;
W : class ui-client-item;
left, right, bottom, top : integer;
debug: truth-value = false;
begin

if debug then
    inform the operator that "Running upp-manage-slider-method ";

make slider transient;
transfer slider to WS at (x, y);
make pointer transient;
call upp-adjust-slider-position(slider);
left, right, top, bottom = call upp-get-slider-pointer-offsets (slider);
transfer pointer to WS at (left + the item-width of pointer / 2, the item-y-position of slider - 1);
conclude that the x-position of pointer = the item-x-position of pointer; 
conclude that the y-position of pointer = the item-y-position of pointer; 
call upp-adjust-slider-position(slider); 
conclude that the uil-is-managed of slider = 1;

call upp-rebind-pointer-boundaries (pointer);

if the uil-is-permanent of slider is true then
    call upp-make-slider-permanent (slider);

return slider;
end

upp-update-slider-method (G: class item, W: class ui-client-item, D: class item, B: item-or-value, action-queue: item-or-value)
OBJ: class item; 
pointer: class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in G;
WS: class kb-workspace = the workspace of G;
VAL: value;
left, right, bottom, top: integer;
ATT: symbol;
Status: truth-value;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running upp-update-slider-method";

    OBJ  = call uil-find-source-object (G, D);

    if (OBJ is an item) then
        begin
        if debug then 
            inform the operator that "OBJ is: [the class of OBJ]";
        VAL, Status = call upp-extract-source-value (G, D);
        if debug then
            inform the operator that "Status is: [Status]  VAL is: [VAL]";
        
        if (status) then
            begin
            conclude that the current-value of G = VAL;
            make pointer transient;
            call upp-adjust-slider-position (G);
            end;
        end;
end

upp-clone-slider-method (slider : class uil-slider) = (item-or-value)
new-slider : class uil-slider;
pointer : class uil-slider-pointer;
debug: truth-value = false;
en : symbol; et : text;
begin
if debug then
    inform the operator that "Running upp-clone-slider-method.";
create a uil-slider new-slider by cloning slider;
create an instance pointer of the class named by the uil-slider-pointer-class-to-create of slider;
conclude that new-slider is the-container-for pointer; 
conclude that the uil-slider-creation-flag of new-slider = the symbol newly-created;
return new-slider;
end 
on error (en, et)
if debug then
    inform the operator that "[en][et]";
return the symbol slider-not-cloned;
end

upp-delete-slider-method (slider:class uil-slider)
pointer: class uil-slider-pointer;
debug: truth-value = false;
begin
if debug then
    inform the operator that "Running upp-delete-slider-method";

if the uil-slider-pointer that is the-pointer-in slider exists then
  begin
    pointer = the uil-slider-pointer that is the-pointer-in slider;
    make pointer transient;
    delete pointer;
  end;

make slider transient;
delete slider;

end

upp-make-slider-permanent (slider:class uil-slider)
pointer: class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
en : symbol; et : text;
begin
conclude that the uil-is-permanent of slider is true;
make slider permanent;

end

on error (en , et)
end

upp-slider-tracking-internals (type : symbol , W : class g2-window, ITM1 : item-or-value, ITM2 : item-or-value, x1 : integer, y1: integer, x2 : integer, y2 : integer)
slider : class uil-slider;
debug: truth-value = false;
begin
if debug then
    inform the operator that "Running upp-slider-tracking-internals  // type=[type]";

if the uil-slider that is the-container-for ITM1 exists then
    slider = the uil-slider that is the-container-for ITM1
  else
    return;

if the state of slider is disabled then
    return;

if type is stop-tracking and the set-value-while-sliding of slider is false then 
  begin
    call upp-adjust-slider-value (slider); 
    return;
  end;

{dwr 8/20/97 -- commented out some code in 4 spots below. The problem is that at the pointer moves towards the edge of the slider, the end of the scale is reached, the slider is permitted to move further, then, at the extremeties of the slider, the pointer jumps as it hits this code. Commenting out these 4 spots prevents the 'jumpiness' of the pointer.--}

if ITM1 is a uil-slider-pointer then
  begin
    if the orientation of slider = 90 or the orientation of slider = 270 then
      begin
        if y1 < the  max-top of ITM1 then y1 = the max-top of ITM1 {- the uil-slider-top-margin of ITM1};
        if y1 > the max-bottom of ITM1 then y1 = the max-bottom of ITM1 {+ the uil-slider-bottom-margin of ITM1};
        move ITM1 to (the x-position of ITM1, y1);
      end
    else 
      begin 
        if x1 < the max-left of ITM1 then x1 = the max-left of ITM1 {+ the uil-slider-left-margin of ITM1};
        if x1 > the max-right of ITM1 then x1 = the max-right of ITM1 {- the uil-slider-right-margin of ITM1};
        move ITM1 to (x1, the y-position of ITM1);
      end;
    if debug then
        inform the operator that "[type] x1=[x1]  y1=[y1]  max-top=[the max-top of ITM1]  max-bottom=[the max-bottom of ITM1]";
    if the set-value-while-sliding of slider is true then
        call upp-adjust-slider-value (slider);
    return;
  end; 

end

upp-get-slider-pointer-offsets (slider : class uil-slider) = (integer, integer, integer, integer)
left, right, bottom, top : integer;
horizontally-oriented : truth-value = false;
vertically-oriented : truth-value = false;
pointer : class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
debug: truth-value = false;
begin
if the orientation of slider = 0 or the orientation of slider = 180 then
    horizontally-oriented = true
  else
    vertically-oriented = true;

if horizontally-oriented then 
    begin
        left = the item-x-position of slider - truncate (the item-width of slider / 2) + the x-margin of slider + the uil-slider-left-margin of pointer;
        right = the item-x-position of slider + truncate (the item-width of slider / 2) - the x-margin of slider - the uil-slider-right-margin of pointer ;
        bottom = the item-y-position of slider - the y-margin of slider - the uil-slider-bottom-margin of pointer ;
        top = the item-y-position of slider + the y-margin of slider + the uil-slider-top-margin of pointer ;
    end;

if vertically-oriented then 
    begin
        left = the item-x-position of slider - the x-margin of slider - the uil-slider-left-margin of pointer ; 
        right = the item-x-position of slider - the x-margin of slider + the uil-slider-right-margin of pointer; 
        bottom = the item-y-position of slider - truncate (the item-height of slider / 2) + truncate (the item-height of pointer / 2) + the y-margin of slider + the uil-slider-top-margin of pointer ;
        top= the item-y-position of slider + truncate (the item-height of slider / 2) - truncate (the item-height of pointer / 2) - the y-margin of slider - the uil-slider-bottom-margin of pointer;
    end;

if debug then
    inform the operator that "orientation=[the orientation of slider]   left=[left]  right=[right]  bottom=[bottom]  top=[top]";

return left, right, bottom, top;

end

