pointer : class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
begin
    conclude that the state of slider is disabled;
    call uil-configure-grobj-method (slider);
end

upp-enable-slider-method (slider : class uil-slider)
pointer : class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
begin
    conclude that the state of slider is enabled;
    call uil-configure-grobj-method (slider);
end

upp-set-slider-value(Slider : class uil-slider, Val : quantity)
begin
    conclude that the current-value of Slider = Val;
    call upp-adjust-slider-position (Slider);
end

upp-execute-value-changed-callback(Slider : class uil-slider, Win: class ui-client-item, DlgOrWksp: class item)
Proc : class procedure;
begin
    if (the value-changed-callback of Slider exists) and (the value-changed-callback of Slider /= the symbol unspecified) and (the procedure Proc named by the value-changed-callback of Slider exists) then call Proc(Slider, Win, DlgOrWksp);
end

guide-clone-slider (slider : class uil-slider) 
new-slider : class uil-slider;
begin
new-slider = call uil-clone-grobj-method (slider);
conclude that the uil-slider-creation-flag of new-slider = the symbol ok;
call uil-manage-grobj-method (new-slider, the workspace of slider, the symbol none, the item-x-position of slider + truncate (the item-width of new-slider / 2), the item-y-position of slider - 20);
call upp-make-slider-permanent (new-slider);
end

upp-initialize-slider-method (slider : class uil-slider)
pointer: class uil-slider-pointer;
debug: truth-value = false;
begin
if debug then
    inform the operator that "Running upp-initialize-slider-method.";
if not (there exists a uil-slider-pointer that is the-pointer-in slider) then
  begin
      call upp-create-slider-pointer (slider);
      call uil-manage-grobj-method (slider, the workspace of slider, the symbol none, the item-x-position of slider, the item-y-position of slider);
  end;
end

upp-post-creation-processing (slider : class uil-slider)
pointer : class uil-slider-pointer;

begin
    if the uil-slider-pointer that is the-pointer-in slider does not exist then
      begin
        create an instance pointer of the class named by the uil-slider-pointer-class-to-create of slider;
        conclude that slider is the-container-for pointer;
      end;

    conclude that the uil-slider-creation-flag of slider = the symbol ok;

    call uil-manage-grobj-method (slider, the workspace of slider, the symbol none, the item-x-position of slider, the item-y-position of slider);

    call uil-configure-grobj-method (slider);

end

upp-initialize-sliders ()
slider : class uil-slider;
pointer: class uil-slider-pointer;
mode : symbol ;
W : class ui-client-item;
left, right, bottom, top : integer;
begin
    for pointer = each uil-slider-pointer do
        make pointer transient;
        delete pointer ;
        end;

    for slider = each uil-slider do
        call uil-initialize-grobj-method (slider);
        end;
end

