return pointer;
end

upp-adjust-slider-value (slider : class uil-slider)
D : class item;
W : class ui-client-item ;
WS : class kb-workspace = the workspace of slider;
initiating-object : item-or-value;
pointer : class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
x, new-val, lo, hi, delta, diff: float;
hi-value, lo-value : value;
left, right, top, bottom, int-val: integer;
en : symbol; et : text;
debug: truth-value = false;
begin
if debug then inform the operator that "Running upp-adjust-slider-value";

if (the workspace of slider exists) then
    WS = the workspace of slider
else
    return;

if there exists an item superior to WS and the item superior to WS is a uil-dialog then
    D = the uil-dialog superior to WS;

if D exists and the ui-client-item that is the-g2-window-now-showing-dialog D exists then
    W = the ui-client-item that is the-g2-window-now-showing-dialog D
else
     for W = each ui-client-item do 
          exit if true;
     end;

lo-value = the lo-value of slider;
hi-value = the hi-value of slider;
if lo-value is not a quantity or
  hi-value is not a quantity then
    begin
        call uil-post-generic-dialog ("While updating a slider's value, either the slider's hi-value or lo-value attributes were determined to be non-numeric. The slider's value was not updated", the symbol message, the symbol medium, W, the symbol uil-information-icon);
        return;
    end;

if the orientation of slider = 90 or the orientation of slider = 270 then
  begin
    top = round (the item-height of pointer / 2) + the y-margin of slider; 
    bottom = top; 
    lo = (the item-y-position of slider - the item-height of slider / 2) + top; 
    hi = (the item-y-position of slider + the item-height of slider / 2) - bottom;
    diff = the item-y-position of pointer - lo; 
  end
  else
  begin
    left = round (the item-width of pointer / 2) + the x-margin of slider;
    right = left;
    lo = (the item-x-position of slider - the item-width of slider / 2) + left; 
    hi = (the item-x-position of slider + the item-width of slider / 2) - right;
    diff = the item-x-position of pointer - lo;
  end;

if hi = lo then
    x = 1
else
    x = max (0, min (1, (diff / (hi - lo))));
delta = the hi-value of slider - the lo-value of slider;

new-val = the lo-value of slider + (x * delta);

if debug then
  inform the operator that "x=[x]   delta=[delta]   new-val=[new-val]";

if new-val <  lo-value then
  new-val =  lo-value; 
if new-val >  hi-value then
  new-val = hi-value; 

if the allow-fractional-increments of slider is false then
    begin
      int-val = truncate (new-val);
      conclude that the current-value of slider = int-val; 
    end
 else
    conclude that the current-value of slider = new-val;

{-- sdm: 3/5/97 --}
if (the uil-conclude-value-immediately of slider is true) and (the uil-conclude-method of slider exists and the procedure named by the uil-conclude-method of slider exists) then
    begin
    if (DEBUG) then
        inform the operator that "conclude-value-immediately is true";

    if (D exists) then
        call the procedure named by the uil-conclude-method of slider (slider, W, D, slider, the symbol none)
    else
        call the procedure named by the uil-conclude-method of slider (slider, W, WS, slider, the symbol none)
    end;

{cmh: 5-16-97}
if (D exists) then call upp-execute-value-changed-callback (slider, W, D)
else call upp-execute-value-changed-callback (slider, W, WS);
end

