left, right, bottom, top = call upp-get-slider-pointer-offsets (slider);
    
{call g2-clear-movement-limits (P, the symbol unless, the symbol administrator);
    
call g2-set-movement-limits (P, the symbol unless, the symbol administrator, left, right, bottom, top); }

if debug then
    inform the operator that "Binding . . . left=[left]  right=[right]  bottom=[bottom]  top=[top]";

end

upp-adjust-slider-graphics (W : class ui-client-item, mode : symbol)
slider : class uil-slider;
pointer : class uil-slider-pointer;
begin
for pointer = each uil-slider-pointer do
   call upp-rebind-pointer-boundaries (pointer);
    end ;
end

upp-move-slider (slider : class uil-slider)
pointer: class uil-slider-pointer;
mode : symbol ;
WS : class kb-workspace = the workspace of slider;
W : class ui-client-item ;
left, right, bottom, top : integer;
begin

pointer =  the uil-slider-pointer that is the-pointer-in slider;

left, right , top, bottom = call upp-get-slider-pointer-offsets (slider);

{Take care of slider first}
make slider transient;

{Next, take care of pointer.}
make pointer transient;

call upp-adjust-slider-position(slider);

{Now, make the slider permanent again if it is permanent.}
if the uil-is-permanent of slider then 
   call upp-make-item-permanent (slider);

conclude that the uil-is-managed of slider = 1;

call upp-rebind-pointer-boundaries (pointer);

end

upp-adjust-slider-position (slider : class uil-slider)
pointer : class uil-slider-pointer = the uil-slider-pointer that is the-pointer-in slider;
WS : class kb-workspace;
orientation : symbol ;
CV: quantity;
x, y, lo, hi, half-width, half-height, diff: float;
l, r, t, b: integer;
pos, top, margin: integer;
debug: truth-value = false;
en : symbol; 
et : text;
begin
if not (the workspace of slider  exists) then
    return
else
    WS = the workspace of slider;

if not (text-begins-with-quantity ("[the current-value of slider]")) then
    CV = 0
else
    CV = the current-value of slider;
make pointer transient;
if the orientation of slider = 0 or the orientation of slider = 180 then
  orientation = the symbol horizontal
else
  orientation = the symbol vertical;

half-width = round (the item-width of pointer / 2);
half-height = round (the item-height of pointer / 2);
margin = 2;
l, r, t, b = call upp-get-slider-pointer-offsets (slider);
conclude that the max-left of pointer = l; 
conclude that the max-right of pointer = r; 
conclude that the max-top of pointer = t; 
conclude that the max-bottom of pointer = b; 

if orientation is horizontal then
  begin
    {Horizontal computation}
    lo = (the item-x-position of slider - the item-width of slider / 2) + half-width + the x-margin of slider; 
    hi = (the item-x-position of slider + the item-width of slider / 2) - half-width - the x-margin of slider;
    diff = hi - lo;
    x = truncate (lo + ((CV - the lo-value of slider) / (the hi-value of slider - the lo-value of slider) * diff));
    pos = truncate (max (lo, min (hi, x)));
    transfer pointer to WS at (pos,t); 
  end
  else
  begin
    {Vertical computation}
    lo = (the item-y-position of slider - the item-height of slider / 2) + half-height + the y-margin of slider; 
    hi = (the item-y-position of slider + the item-height of slider / 2) - half-height - the y-margin of slider;
    diff = hi - lo;
    y = truncate (lo + ((CV - the lo-value of slider) / (the hi-value of slider - the lo-value of slider) * diff));
    pos = truncate (max (lo, min (hi, y)));
    transfer pointer to WS at (l, pos);
  end;

conclude that the x-position of pointer = the item-x-position of pointer;
conclude that the y-position of pointer = the item-y-position of pointer;

if debug then
    inform the operator that "Adjusting . . .[crlf]lo=[lo]   hi=[hi][crlf]   diff=[diff]   pos=[pos]";

end

g2:c.METHOD.g2:a.TEXT:
gold-map-item-to-context (I : class uil-slider-pointer, Win : class ui-client-item) = (item-or-value)
Slider : class uil-slider;
ContextItem : class item;
DEBUG: truth-value = false; 
begin
   if DEBUG then inform the operator that "called map uil-slider-pointer to context"; 
   if there exists a uil-slider Slider that is the-container-for I then begin
       ContextItem = call gold-map-item-to-context (Slider, Win);
       return ContextItem;
   end
   else
       return false;
end
